Let the number of quarters in the first, second, third, and fourth piles be $a$, $b$, $c$, and $d$, respectively. We have the equations \begin{align*} \tag{1}
a+b+c+d&=27\\ \tag{2}
a&=b-5\\ \tag{3}
b&=c+4\\ \tag{4}
d&=3b
\end{align*} We want to find the value of $d$. We will express each of $a$, $b$, and $c$ in terms of $d$ and then substitute these equations into Equation (1) to find the value of $d$. From Equation (4), we have $b=d/3$. From Equation (3), we have $c=b-4$. Since $b=d/3$, we can rewrite Equation (3) as $c=d/3-4$. We can substitute $b=d/3$ into Equation (2) to get $a=d/3-5$. Substituting $b=d/3$, $c=d/3-4$, and $a=d/3-5$ into Equation (1) to eliminate $a$, $b$, and $c$, we get $(d/3-5)+d/3+(d/3-4)+d=27$, so $d=18$. Thus, there are $\boxed{18}$ quarters in the fourth pile.

Multiply all three equations to find that  \begin{align*}
\frac{a}{b}\cdot\frac{b}{c}\cdot\frac{c}{d}&=\frac{3}{5}\cdot\frac{15}{6}\cdot\frac{6}{1} \implies \\
\frac{a}{d}&=\boxed{9}.
\end{align*}

Let $a$ denote the price of a sack of apples, $b$ the price of a bunch of bananas, $c$ the price of a cantaloupe, and $d$ the price of a carton of dates. We can express the information given in the problem by the following system of linear equations:  \begin{align*}
a+b+c+d &= 20\\
2a &= d\\
a-b &= c
\end{align*}

Substituting into the first equation for $c$ and $d$ gives $a + b + a - b + 2a = 20$, which simplifies to $4a = 20$, so $a = 5$. From here, we use $a$ to find $d = 2 \cdot 5 = 10$. We put these values into the first equation to get $5 + b + c + 10 = 20$, so $b + c = \boxed{ \$ 5}$.

