solution:
Using the quadratic formula $x = \frac{ - b \pm \sqrt {b^2 - 4ac} }{2a}$, we can find the roots of the quadratic. We find that $x = \frac{-5 \pm \sqrt{25-4c}}{2}$. Thus, setting our two expressions for $x$ equal to each other, we find that  \begin{align*}
\frac{-5 \pm \sqrt{25-4c}}{2} &= \frac{-5 \pm \sqrt{c}}{2} \quad \Rightarrow \\
25 - 4c &= c \quad \Rightarrow \\
c &= \boxed{5}.
\end{align*}

Using the quadratic formula, we find that the roots of the quadratic are $\frac{-7\pm\sqrt{7^2-4(4)(k)}}{8}=\frac{-7\pm\sqrt{49-16k}}{8}$. Since the problem tells us that these roots must equal $\frac{-7\pm\sqrt{15}i}{8}$, \begin{align*} \sqrt{49-16k}&=\sqrt{15}i
\\\Rightarrow\qquad \sqrt{49-16k}&=\sqrt{-15}
\\\Rightarrow\qquad 49-16k&=-15
\\\Rightarrow\qquad 16k&=64
\\\Rightarrow\qquad k&=\boxed{4}.
\end{align*}

To begin, we observe that the expression $\frac{\sqrt{6y+2}}{\sqrt{2y}}$ is defined if and only if $y>0$. In this case, it is equal to $\sqrt{\frac{6y+2}{2y}}$. Since the quantity under the radical is always nonnegative for $y>0$, we may safely square both sides of our equation without creating fake solutions: $$\frac{6y+2}{2y}=\frac{25}{4}.$$Now we cross-multiply to obtain $$4(6y+2) = 25(2y),$$and solve this linear equation: \begin{align*}
24y+8 &= 50y \\
8 &= 26y \\
\boxed{\frac{4}{13}} &= y
\end{align*}

