Let \[f(x) = \left\{
\begin{array}{cl}
2x + 1 & \text{if } x \le 3, \\
8 - 4x & \text{if } x > 3.
\end{array}
\right.\]Find the sum of all values of $x$ such that $f(x) = 0.$

solution:
Factoring our original equation: \[3x^2+10x-25=(3x-5)(x+5)=0\]Therefore, the two solutions are $3x-5=0$ and $x+5=0$. \begin{align*}
3x-5&=0\\
3x&=5\\
x&=\frac{5}{3}
\end{align*}
\begin{align*}
x+5&=0\\
x&=-5
\end{align*}Therefore, either $d$ or $e$ could equal either $\frac{5}{3}$ or $-5$. However, $(d-e)^2=(e-d)^2$ as shown below. \begin{align*}
(d-e)^2&=\{(-1)(e-d)\}^2\\
&=(-1)^2(e-d)^2\\
&=(e-d)^2
\end{align*}Setting $\frac{5}{3}=d$ and $-5=e$: \begin{align*}
(d-e)^2&=\left(\frac{5}{3}-(-5)\right)^2\\
&=\left(\frac{5}{3}+5\right)^2\\
&=\left(\frac{20}{3}\right)^2\\
&=\boxed{\frac{400}{9}}
\end{align*}

The common ratio between consecutive terms is $\frac{6}{4} = \frac{3}{2}$ (we could have chosen any two consecutive terms and divided the second one by the first to find the common ratio; we chose 4 and 6 because they seemed simple). So the $n^\text{th}$ term of the sequence is $\frac{16}{9} \cdot \left( \frac{3}{2} \right)^{n-1}$. Plugging in $n=8$, we get $$
\frac{16}{9} \cdot \left( \frac{3}{2} \right)^{7} = \frac{2^4}{3^2} \cdot \frac{3^7}{2^7}
= \frac{3^5}{2^3}
= \boxed{\frac{243}{8}}.
$$

This is a finite geometric series with first term $\frac{1}{2}$, common ratio $\frac{1}{2}$ and $10$ terms. Therefore the sum is: $$\frac{\frac{1}{2}\left(1-\frac{1}{2^{10}}\right)}{1-\frac{1}{2}}
=\frac{\frac{2^{10}-1}{2^{11}}}{\frac{1}{2}}
= \frac{2^{10}-1}{2^{10}}=\boxed{\frac{1023}{1024}}.$$

We begin by adding 2 to both sides of the equation, \begin{align*} 7&=x^2+\frac{1}{x^2}
\\\Rightarrow\qquad 9&=x^2+\frac{1}{x^2}+2
\\\Rightarrow\qquad 9&=x^2+2(x)\left(\frac{1}{x}\right)+\frac{1}{x^2}
\\\Rightarrow\qquad 9&=\left(x+\frac{1}{x}\right)^2
\end{align*}  So, the possible values for $x+\frac{1}{x}$ are $3$ and $-3$. The greater of these is $\boxed{3}$.

The givens tell us that $\frac{x+y}{2}=7$ and $\sqrt{xy}=\sqrt{19}$, or $x+y=14$ and $xy=19$. $(x+y)^2=x^2+2xy+y^2$, so  \[
x^2+y^2=(x+y)^2-2xy=14^2-2\cdot19=196-38=\boxed{158}
\]

