Then $|f(a)-a|$ is the vertical distance from the green to the red graph at $x=a$. We can see that this distance varies from $0$ to $1$, inclusive of $0$ but not of $1$ (since the hollow dots on the graph of $y=f(x)$ represent points which are not part of the graph). Since $f(x)\le x$ for all $x$, we see that $f(x)-x$ is zero or negative, and its range is $\boxed{(-1,0]}$.

Since 2, 3, and 7 are all primes, the denominator is in simplest radical form and we can't simplify it further. We attack this problem by getting rid of the square roots one step at a time. First we group the first two terms, and multiply numerator and denominator by the conjugate: \begin{align*}
\frac{1}{(\sqrt{2} + \sqrt{3}) + \sqrt{7}} & = \frac{1}{(\sqrt{2} + \sqrt{3}) + \sqrt{7}} \cdot \frac{(\sqrt{2} + \sqrt{3}) - \sqrt{7}}{(\sqrt{2} + \sqrt{3}) - \sqrt{7}} \\
& = \frac{(\sqrt{2} + \sqrt{3}) - \sqrt{7}}{(\sqrt{2} + \sqrt{3})^2 - (\sqrt{7})^2} \\
& = \frac{(\sqrt{2} + \sqrt{3}) - \sqrt{7}}{2 + 2\sqrt{6} + 3 - 7} \\
& = \frac{\sqrt{2} + \sqrt{3} - \sqrt{7}}{-2 + 2\sqrt{6}}
\end{align*}Now this is in a form we know how to deal with, and we can just multiply by the conjugate as usual: \begin{align*}
\frac{\sqrt{2} + \sqrt{3} - \sqrt{7}}{-2 + 2\sqrt{6}} & = \frac{\sqrt{2} + \sqrt{3} - \sqrt{7}}{-2 + 2\sqrt{6}} \cdot \frac{-2 - 2\sqrt{6}}{-2 - 2\sqrt{6}} \\
& = \frac{-2\sqrt{2} - 2\sqrt{3} + 2\sqrt{7} - 2\sqrt{12} - 2\sqrt{18} + 2\sqrt{42}}{-20} \\
& = \frac{4\sqrt{2} + 3\sqrt{3} - \sqrt{7} - \sqrt{42}}{10}.
\end{align*}This gives $A + B + C + D + E + F = 4 + 3 - 1 - 1 + 42 + 10 = \boxed{57}$.

Rewrite the equation of the parabola as $y=a(x-h)^2+k$, where $a$, $h$, and $k$ are constants and $(h,k)$ are the coordinates of the vertex. If the parabola has a vertical line of symmetry at $x=1$, then the $x$-coordinate of the vertex is $x=1$, so $h=1$. The equation of the parabola becomes $y=a(x-1)^2+k$. Plugging in the two given points into this equation, we have the two equations \begin{align*}
3&=a(-1-1)^2+k \Rightarrow 3=4a+k\\
-2&=a(2-1)^2+k \Rightarrow -2=a+k
\end{align*} Subtracting the second equation from the first yields $5=3a$, so $a=5/3$. Plugging this value into the second equation to solve for $k$, we find that $k=-11/3$. So the equation of the parabola is $y=\frac{5}{3}(x-1)^2-\frac{11}{3}$. To find the zeros of the parabola, we set $y=0$ and solve for $x$: \begin{align*}
0&=\frac{5}{3}(x-1)^2-\frac{11}{3}\\
\frac{11}{3}&=\frac{5}{3}(x-1)^2 &\\
\frac{11}{5}&=(x-1)^2\\
x &= \pm\sqrt{\frac{11}{5}}+1
\end{align*}

The greater zero is at $x=\sqrt{\frac{11}{5}}+1$, so $n=\boxed{2.2}$. The graph of the parabola is below:

