There are three intersections. The leftmost intersection lies on the line of slope $2$ through the origin, which is $y=2x$. Solving $2x=1.8$ yields $x=0.9$.

The middle intersection lies on the line of slope $-1$ through $(2,1)$, which is $y=-x+3$. Solving $-x+3=1.8$ yields $x=1.2$.

The rightmost intersection lies on the line of slope $2$ through $(2,1)$, which is $y=2x-3$. Solving $2x-3=1.8$ yields $x=2.4$.

Thus, the sum of the three $x$-coordinates is $0.9+1.2+2.4=\boxed{4.5}$.

The distance between the midpoint of $\overline{AB}$ and an endpoint of $\overline{AB}$ is equal to half of the length of $\overline{AB}$. By the distance formula,

\begin{align*}
AB &= \sqrt{((t-4)-(-2))^2 + ((-1)-(t+3))^2}\\
&= \sqrt{(t-2)^2+(t+4)^2} \\
&= \sqrt{2t^2 + 4t + 20}
\end{align*}Also, we know that $(AB/2)^2 = t^2/2 \Longrightarrow AB = 2\sqrt{t^2/2} = \sqrt{2t^2}$. Setting these two expressions equal and squaring, we obtain $$AB^2 = 2t^2 = 2t^2 + 4t + 20 \Longrightarrow 4t + 20 = 0.$$Thus, $t = \boxed{-5}$.

If $x^2 + kx + 15= (x+a)(x+b)$, then \[x^2 + kx + 15 = x^2 + ax +bx +ab = x^2 +(a+b)x + ab.\]Therefore, we must have $ab = 15$, and for any such $a$ and $b$, we have $k = a+b$.   There are four pairs of integers that multiply to 15.  They are 1 and 15 (which give $k=16$), 3 and 5 (which give $k=8$), $-1$ and $-15$ (which gives $k=-16$), and -3 and -5 (which give $k=-8$).  The product of these four possible values of $k$ is \begin{align*}
(16)(8)(-16)(-8)& = (2^4)(2^3)(-2^4)(-2^3)\\
& = 2^{4+3+4+3} \\&= 2^{14}\\& = 2^{10}\cdot 2^4 = (1024)(16) = \boxed{16384}.
\end{align*}

